import React from 'react'
import Navbar from './component/pages/Navbar';
import { Switch,Route } from 'react-router-dom';
import Home from './component/pages/Home';



const App = () => {
    return (
        <>
           <Navbar/>
              <Switch>
                  <Route path="/" component={Home}/>
              </Switch>
        </>
    )
}

export default App;
